INSERT INTO sysconfig (sysconfig_pk, variablename, conf_value, ui_label, vartype, group_name, group_order, description, validation_function) VALUES (2, 'SupportEmailAddr', NULL, 'Support Email Address', 2, 'Support', 2, 'e.g. "support@mycompany.com"<br>Individual or group email address to those providing FOSSology support.', 'check_email_address');
